import React from "react";
import './LoginBox.css';
import { useState } from "react";
import { Component } from "react";

const [id, setId] = useState(null);
const [pw, setPw] = useState(null);

function Login(){
    return (
        <div class='loginButtonBox'>
            <button class='login' onClick={
                setId()
            }>Login</button>
        </div>
    );
}

function LoginBox(){
    const [idValue, setIdValue] = useState(null);
    return (
        <div class='LoginBox'>
            <h1 class='Text'>Welcome!</h1>
            <div class='inputBox'>
                <div class='info'>
                    <text class='text'>ID</text>
                    <input type='text' value={idValue} onChange={setIdValue} class='inputField' id='idText'></input>
                </div>
                <div class='info'>
                    <text class='text'>password</text>
                    <input type='text' class='inputField' id='passwordText'></input>
                </div>
                <Login onChangeMode={function(){
                    setId(idValue);
                }}></Login>
            </div>
        </div>
    );
}

export default LoginBox;
